import React from 'react';
import './content.css';
import DrawerToggleButton from '../SideDrawer/drawerToggleButton'
import WelcomeContent from './Welcome/welcomecontent'
import AppScreen from './AppComming/AppScreen'
import {BrowserRouter as Router, Switch, Route, withRouter} from 'react-router-dom' 

class Content extends React.Component{
    render(){
        return(
            <div className="background">
                <div className="upperbar">
                    <DrawerToggleButton click={this.props.drawerClickHandler} />
                    <button className="notify">Notify Me</button>
                </div>
                <div className="main">
                    
                        <Switch>
                            <Route exact path="/" component={WelcomeContent}/>
                            <Route  path="/ourteam" component={WelcomeContent}/>
                            <Route  path="/app" component={AppScreen}/>
                            <Route  path="/blog" component={WelcomeContent}/>
                            
                        </Switch>
                    
                </div>
                <div className="footer">
                    <button className="fb"></button>
                    <button className="insta"></button>
                    <button className="phone"></button>
                </div>
            </div>
        );
    }
}
export default Content;
